content:
Член 2
Одделните изрази употребени во овој закон го имаат следново значење:
1. ”Научно-истражувачка дејност” ги опфаќа фундаменталните и применетите истражувања чии резултати содржат изворност/оригиналност, а се насочени кон проширување и унапредување на дејноста и на вкупните знаења;
2. “Апликативни (применливи) истражувања” опфаќаат трансфер на знаења за подобрување на постојните и воведување нови технологии, како и примена на тие знаења во изнаоѓање практични решенија за развојот на стопанството;
3. “Високообразовни установи” се универзитет и висока стручна школа;
4. “Државен универзитет” е јавна установа основана од Република Македонија, врз основа на закон, за остварување на јавниот интерес во образовната и научно-истражувачката дејност;
5. “Приватен универзитет” е установа основана од правно или физичко лице за остварување на образовната и научно-истражувачката дејност;
6. “Самостојна државна високообразовна установа” е јавна установа која врши образовна дејност од прв циклус во траење од најмалку три години и образование од втор циклус специјалистичко образование во траење од најмалку една година, и која спроведува развојни и применети истражувања;
7. “Самостојна приватна високообразовна установа” е установа основана од домашно или странско правно или физичко лице која врши образовна дејност од прв циклус во траење од најмалку три години и образование од втор циклус специјалистичко образование во траење од најмалку една година, и која спроведува развојни и применети истражувања;
8. “Јавна научна установа” е самостојна научна установа, основана со одлука на Владата на Република Македонија, која врши дејност од висок стратешки и национален интерес за Република Македонија;
9. “Мешовита научна установа” е установа основана од Република Македонија од една страна и од странско или од домашно правно или физичко лице, од друга страна;
10. “Приватна научна установа” е установа основана од домашно правно или физичко лице;
11. “Истражувач” е физичко лице кое врши научно-истражувачка дејност и научни истражувања во субјектите на научно-истражувачката дејност; 
12. “Раководител на проект” е истражувач кој раководи со научно-истражувачки проекти;
13. “Самостоен истражувач” е физичко лице кое самостојно врши научно-истражувачка дејност во согласност со овој закон и
14. “Научно-истражувачка инфраструктура” се објекти, лаборатории и опитни станици, иновациони центри, сметачки центри, научна опрема, библиотечно-информациони и реферални центри, архивска и издавачка документација, како и сé друго што придонесува за научни истражувања.
II. НАЧЕЛА ВО НАУЧНО-ИСТРАЖУВАЧКАТА ДЕЈНОСТ
